var iconePersonalizzate=function(){var a=this;this.arrayIcone={};this.formulaContenutoHtml=function(e,c){var d=a.arrayIcone[e+c];var b="";for(i=0;i<d.length;i++){b+="<img src='images/"+e+"/"+c+"/"+d[i]+"' style='margin:5px' />"}return b};this.caricaTuttoSet=function(b){a.leggiCartellaSet(b,"gruppo");a.leggiCartellaSet(b,"ingresso");a.leggiCartellaSet(b,"ingressoAnalogico");a.leggiCartellaSet(b,"interruttore");a.leggiCartellaSet(b,"interruttoreTem");a.leggiCartellaSet(b,"pulsanteAuto");a.leggiCartellaSet(b,"schedulatore");a.leggiCartellaSet(b,"send");a.leggiCartellaSet(b,"statusMonitor")};this.caricaTutteImmagini=function(){if(localStorage.nomiImmagini==undefined){a.caricaTuttoSet("set1");a.caricaTuttoSet("set2");a.caricaTuttoSet("set3");a.caricaTuttoSet("set4");localStorage.nomiImmagini=JSON.stringify(a.arrayIcone)}else{a.arrayIcone=JSON.parse(localStorage.nomiImmagini)}};this.leggiCartellaSet=function(c,b){$.ajax({type:"GET",url:"images/"+c+"/"+b+"/",timeout:6000,async:false,error:function(d){alert("errore")},success:function(d){var e=new Array;$(d).find("a").each(function(){var f=$(this).attr("href");var g=f.replace("/personal/images/"+c+"/"+b+"/","");if(g.indexOf("Spento")>0||g.indexOf("gruppo")>-1){e.push(g)}});a.arrayIcone[c+b]=e}})}};